import React from 'react';
import {Routes,Route} from "react-router-dom";
import LocalRoute from "./LocalRoute";
import AramaPage from "../page/AramaPage";
import GirisPage from "../page/GirisPage";

const DüzenRoute = () => {
  return (
    <div>
       <Routes>
           <Route path="/arama" element={<LocalRoute><AramaPage/></LocalRoute>}></Route>

           <Route path="/" element={<GirisPage/>}/>

        </Routes> 
    </div>
  )
}

export default DüzenRoute
